    return (
        <div className='flex flex-col gap-y-1'>
            <label htmlFor="ok">{tit}</label>
            <input id='ok' type="text" className="py-1 w-[250px] text border border-b-[#9CA3AF] border-transparent leading-6 outline-none" placeholder="Name" />
        </div>
    );
};

export default InputAll;
